import React from 'react';
const Sre = () => {
  
    const img = `https://source.unsplash.com/user/erondu/400x300/?mango`;
  
    return(
       
        <>
            <div>
                <img src={img} alt="images"/>
            </div>
        </>
    );
}

export default Sre;
